description:
I take a lot, so I'm giving a little.  This is a collection of scenes of Jo from various Viv Thomas productions.  Standard means they are all DVD res or lower, none are widescreen.  This by no means a complete collection, but it is substantial.  Pick and choose which you want from the thumbnail images below.

Note that my ISP limits all users to about 90kb upload speed, so it'll take several days for me to get this to a 4:1 ratio, which is what I guarantee to seed.  If that's too slow for you, then it's simple - don't download.  You've been warned.


